import React from 'react';
// import allAnimalsData from '../components/assets/dogs'; // Example path, adjust as needed
import ShopContext from './ShopContext';

const ShopContextProvider = (props) => {
  const contextValue = {
    id: 1,
    breed: "Labrador Retriever",
    image: "https://upload.wikimedia.org/wikipedia/commons/thumb/3/34/Labrador_on_Quantock_%282175262184%29.jpg/1200px-Labrador_on_Quantock_%282175262184%29.jpg",
    price: "$800 - $2,000",
    gender: "Male",
    weight: "65-80 lbs",
    height: "22.5-24.5 in",
    category: "dog",
    voice: "",
    sellerId: "",
    sellerName: "" // Assuming this is how your data is structured
  };

  return (
    <ShopContext.Provider value={contextValue}>
      {props.children}
    </ShopContext.Provider>
  );
};

export default ShopContextProvider;
